INSERT INTO account_details (account_id, avatar, phone_number, biography, mock_credit_card, interests, location_id) VALUES (1, 'https://ca.slack-edge.com/T04JMHGLC1X-U04QGL4B8BF-d430e03b88d2-512', 8154876654, 'Greg Herren is an accomplished software developer and former project manager at Capital One, based in Herndon, VA. When he is not immersed in the world of tech, he indulges his passion for cars and enjoys life with his supportive spouse.', '1234123412341234', 1, 1)
, (2, 'https://ca.slack-edge.com/T04JMHGLC1X-U04Q5BUFEEM-84df527d192b-512', 5103669813, 'Simon Conrad is a talented software developer based in Washington DC, who brings a unique perspective to his work from his previous career as a chef. With a flair for creativity and a taste for precision, he now combines his passions to craft exceptional code and digital experiences.', '1234123412341234', 2, 2)
, (3, 'https://ca.slack-edge.com/T04JMHGLC1X-U04PN4M85J9-0783702fa3c6-512', 1191711995, 'Travis Semeniv is a skilled software developer hailing from Harrisonburg, VA, with a diverse background as a former Automotive Service Writer. With a passion for technology and a knack for problem-solving, he now thrives in the world of software development, continuously innovating and creating impactful solutions.', '1234123412341234', 3, 3)
, (4, 'https://ca.slack-edge.com/T04JMHGLC1X-U04R7EDGGHF-8c4d5c4db498-512', 1231302222, 'Henry Kim is a versatile software developer hailing from Atlanta, GA, with a diverse background as a former real estate photographer and high school science teacher. When hes not crafting elegant code, he enjoys spending quality time with his loving spouse and two children.', '1234123412341234', 4, 4)
, (5, 'https://randomuser.me/api/portraits/men/11.jpg', 4414292599, 'The musician, Alex Williams, showcases a remarkable talent for crafting melodies that touch the depths of the soul. With a distinctive voice and an ability to evoke emotions through every note, his music leaves an enduring impact on listeners, solidifying their place as a rising star in the music industry.', '1234123412341234', 1, 6)
, (6, 'https://randomuser.me/api/portraits/men/12.jpg', 3075915584, 'The designer, Ethan Reynolds, brings a fresh perspective to the world of fashion, with a fusion of contemporary styles and classic aesthetics. With an innate ability to create garments that exude sophistication and individuality, his designs have garnered praise from fashion enthusiasts and industry insiders alike.', '1234123412341234', 2, 7)
, (7, 'https://randomuser.me/api/portraits/men/13.jpg', 7799273890, 'With an artistic flair that knows no bounds, Jackson Mitchells masterful brushstrokes create captivating and thought-provoking works of art. From surreal landscapes to poignant portraits, Jacksons ability to evoke emotions through his art leaves a lasting impression on viewers, making him a rising star in the art world.', '1234123412341234', 3, 8)
, (8, 'https://randomuser.me/api/portraits/women/11.jpg', 4847798390, 'As a visionary entrepreneur, Olivia Bennetts innovative ideas and relentless drive have led to the successful launch and growth of multiple ventures across diverse industries. With a passion for creating impactful solutions and empowering others, Olivias entrepreneurial journey continues to inspire and make a difference in the business world.', '1234123412341234', 4, 9)
, (9, 'https://randomuser.me/api/portraits/men/14.jpg', 7340012675, 'Alex Ramirez, a dedicated and accomplished athlete, excels in the world of sports with a natural talent and unwavering determination. From winning championships to breaking records, Alexs commitment to excellence sets them apart as a true inspiration to aspiring athletes everywhere.', '1234123412341234', 5, 10)
, (10, 'https://randomuser.me/api/portraits/women/12.jpg', 6911287518, 'Sarah Anderson, a prolific writer, has a unique gift for crafting narratives that resonate with readers, exploring profound themes of love, loss, and the human experience. With several bestselling novels to her name, Sarahs compelling storytelling continues to captivate and inspire readers around the globe.', '1234123412341234', 6, 11)
, (11, 'https://randomuser.me/api/portraits/men/15.jpg', 7290585752, 'Dr. Michael Patel, a brilliant and dedicated scientist, has made significant contributions to the field of biomedical research, with a focus on groundbreaking discoveries in molecular biology. His unwavering pursuit of knowledge and innovative approach to scientific exploration have earned him recognition as a leading figure in the scientific community.', '1234123412341234', 7, 12)
, (12, 'https://randomuser.me/api/portraits/men/16.jpg', 6823947322, 'John Smith, a skilled handyman, brings a wealth of experience and a commitment to excellence to every project he undertakes. Known for his meticulous workmanship and ability to solve a wide range of maintenance and repair issues, Johns reliability and professionalism make him a trusted choice in his community.', '1234123412341234', 8, 13)
, (13, 'https://randomuser.me/api/portraits/men/17.jpg', 7051412993, 'Michael Thompson, a devoted and proactive city councilman, consistently strives to enhance the well-being and prosperity of his constituents. With a keen understanding of local issues and a commitment to transparent governance, Michaels collaborative approach and inclusive policies make him a respected and effective leader in his community.', '1234123412341234', 9, 14)
, (14, 'https://randomuser.me/api/portraits/women/13.jpg', 6093612275, 'As a registered dietitian, Jessica Evans empowers individuals to lead healthier lives through personalized nutrition plans and evidence-based guidance. With a passion for promoting wellness and a wealth of knowledge in the field, Jessicas expertise makes her a trusted resource for those seeking to achieve their health and dietary goals.', '1234123412341234', 10, 15)
, (15, 'https://randomuser.me/api/portraits/women/14.jpg', 3742582099, 'Emma Johnson, a celebrated chef, is renowned for her innovative culinary creations and ability to infuse traditional dishes with a modern twist. Her passion for gastronomy and commitment to using high-quality, local ingredients make her culinary artistry a delightful sensory experience, earning her accolades in the food industry.', '1234123412341234', 11, 16)
, (16, 'https://randomuser.me/api/portraits/women/10.jpg', 4385464957, 'Sarah is a caring elementary school teacher who is passionate about shaping young minds and nurturing a love for learning. Her patience and dedication create a welcoming and supportive environment in her classroom, making her a favorite among her students and their parents.', '1234123412341234', 1, 5)
, (17, 'https://randomuser.me/api/portraits/men/10.jpg', 7149535203, 'Michael is a dedicated firefighter, committed to protecting his community and keeping others safe. With courage and selflessness, he faces life-threatening situations on a daily basis, showcasing his unwavering commitment to serving others.', '1234123412341234', 2, 5)
, (18, 'https://randomuser.me/api/portraits/women/20.jpg', 8882348672, 'Jennifer is an enthusiastic small-business owner, running a charming bookstore that has become a hub for local book lovers. Her love for literature and personalized recommendations create a warm and inviting space where customers feel valued and inspired.', '1234123412341234', 3, 5)
, (19, 'https://randomuser.me/api/portraits/men/20.jpg', 4916688419, 'David is a skilled electrician who takes pride in his workmanship and attention to detail. He is the go-to person for electrical repairs in his neighborhood, always ready to lend a hand to friends and neighbors in need.', '1234123412341234', 4, 5)
, (20, 'https://randomuser.me/api/portraits/women/30.jpg', 5029394812, 'Jessica is a nurturing stay-at-home mom, finding joy in raising her two young children and creating a loving home environment for her family. Her creativity in organizing fun activities and preparing delicious meals makes her a cherished figure in her household.', '1234123412341234', 5, 5)
, (21, 'https://randomuser.me/api/portraits/men/30.jpg', 3387709090, 'Thomas is an avid community gardener, using his green thumb to transform abandoned spaces into vibrant urban oases. His passion for sustainable living and community engagement inspires others to take up gardening and environmental initiatives.', '1234123412341234', 6, 5)
, (22, 'https://randomuser.me/api/portraits/women/40.jpg', 4788434039, 'Laura is a compassionate nurse who goes above and beyond to provide exceptional care to her patients. Her empathetic approach and reassuring presence create a sense of comfort and trust for those under her care.', '1234123412341234', 7, 5)
, (23, 'https://randomuser.me/api/portraits/men/40.jpg', 4411618948, 'Kevin is a dedicated postal worker, diligently delivering mail and packages to residents in his neighborhood, rain or shine. His friendly demeanor and reliability have earned him the respect and admiration of the community he serves.', '1234123412341234', 8, 5)
, (24, 'https://randomuser.me/api/portraits/women/50.jpg', 1584511265, 'Rachel is a talented graphic designer, using her creativity to craft visually stunning designs for various clients and projects. Her ability to bring ideas to life through her artwork has made her an invaluable asset in the marketing and design industry.', '1234123412341234', 9, 5)
, (25, 'https://randomuser.me/api/portraits/men/50.jpg', 7233326889, 'Steven is an enthusiastic amateur astronomer, spending his evenings gazing at the stars and planets through his telescope. His passion for astronomy has led him to organize stargazing events for his community, sharing the wonders of the night sky with others.', '1234123412341234', 10, 5)
, (26, 'https://randomuser.me/api/portraits/men/60.jpg', 6846894516, 'Michael is a resourceful handyman whos always ready to lend a helping hand to his neighbors. Whether its fixing leaky faucets or repairing faulty electronics, hes known as the go-to person in his community. In his downtime, Michael nurtures his creative side, experimenting with woodwork and crafting unique pieces of furniture.', '1234123412341234', 11, 5);

